import React from 'react';
import './navbar.css'

const Navbar = () => {
  return (
    <header>
      <nav>
        <a href="#">دوره ها </a>
        <a href="#" >همکاران ما  </a>
        <a href="#">محتوای فرهنگی </a>
        <a href="#">کتابخانه ها</a>
        <a href="#">مجلات و مقاله ها </a>
        <a href="#">سمینار ها و کنگره ها</a>
      </nav>
      <div class="search-container">
        <input type="text" id="search-input" placeholder="Search..."/>
        <button id="search-button">Search</button>
    </div>
    </header>
  );
}

export default Navbar;
